CREATE procedure [dbo].[insert_Paciente] @xml xml
AS
begin try
	begin transaction
set dateformat dmy

insert "TB_PACIENTE" (
            [NRO_HISTORIA]
           ,[NOM_PACIENTE]
           ,[APE_PATERNO]
           ,[APE_MATERNO]
           ,[TIPO_DOCUM]
           ,[NRO_DOCUM]
           ,[DATE_BIRTH]
           ,[GENERO]
           ,[ID_PAIS]
           ,[ID_REGION]
           ,[ID_PROVINCIA]
           ,[ID_DISTRITO]
           ,[MAN_SUGRIDO_D]
           ,[MAN_SUGRIDO_I]
           ,[EVO_FCH_INTERVENCION]
           ,[EVO_TIME_TRANQRIDO]
           ,[EVO_FCH_CONSULTA]
           ,[EVO_COD_INTERVECION]
           ,[EVO_COD_COMPLICACION]
           ,[USER_CREA]
         )
SELECT 

XmlData.x.value('nro_historia[1]','int') as nro_historia,
XmlData.x.value('nom_paciente[1]','nvarchar(50)') as nom_paciente, 
XmlData.x.value('ape_paterno[1]','nvarchar(50)') as ape_paterno,
XmlData.x.value('ape_materno[1]','nvarchar(50)') as ape_materno,
XmlData.x.value('tipo_docum[1]','char(1)') as tipo_docum,

XmlData.x.value('nro_docum[1]','varchar(10)') as nro_docum,
XmlData.x.value('date_birth[1]','date') as date_birth,
XmlData.x.value('genero[1]','char(1)') as genero,
XmlData.x.value('id_pais[1]','int') as id_pais,
XmlData.x.value('id_departamento[1]','int') as id_departamento,

XmlData.x.value('id_provincia[1]','int') as id_provincia,
XmlData.x.value('id_distrito[1]','int') as id_distrito,

XmlData.x.value('man_sugerido_d[1]','varchar(50)') as man_sugerido_d,
XmlData.x.value('man_sugerido_i[1]','varchar(50)') as man_sugerido_i,

XmlData.x.value('evo_fch_intervencion[1]','date') as evo_fch_intervencion,
XmlData.x.value('evo_time_tranqrido[1]','varchar(50)') as evo_time_tranqrido,
XmlData.x.value('evo_fch_consulta[1]','date') as eva_fch_consulta,
XmlData.x.value('evo_cod_intervencion[1]','char(5)') as evo_cod_intervencion,
XmlData.x.value('evo_cod_complicacion[1]','char(5)') as evo_cod_complicacion,
XmlData.x.value('user_crea[1]','varchar(20)') as user_crea

from @xml.nodes('//data') as XmlData(x)

--select if(@@ROWCOUNT>0,1,0) id_paciente
commit
end try
begin catch
	if @@trancount > 0
		--Insertar log de errores
		rollback 
end catch
GO
